import React from 'react';
import './myStyle.css'

const mystl={
    margin:'100px 0px 0px 100px'
}
const inlinestyle={
    fontSize: '100px',
    color: 'red'
}
function styleSheet() {
    return (
        <center>
        <div className="mystl">
            <h1 style={inlinestyle}>Stylesheet</h1>
        </div>
        </center>
    )
}

export default styleSheet
